#include <iostream>
#include <string>

using namespace std;

class Solution {
public:
    typedef string::size_type s_t;
    string shortestPalindrome(string s) {
        if (s.size() < 2)
            return s;
        s_t last = 0;
        for (s_t i = s.size(); i > 0; --i) {
            if (isPalindrome(s, 0, i-1)) {
                last = i;
                break;
            }
        }
        return string(s.rbegin(), s.rbegin()+s.size()-last) + s;
    }
    bool isPalindrome(const string &s, s_t left, s_t right) {
        if (right-left+1 < 2)
            return true;
        while (left < right) {
            if (s[left] != s[right])
                return false;
            ++left;
            --right;
        }
        return true;
    }
};

int main(void)
{
    cout << Solution().shortestPalindrome("aacecaaa") << endl;
    cout << Solution().shortestPalindrome("abcd") << endl;
    cout << Solution().shortestPalindrome("") << endl;
    return 0;
}
